import React from 'react';

/**
* Simple component with no state.
*
* @return {object} JSX
*/
function Login() {
  const [userName, setUserName] = React.useState('');
  const [password, setPassword] = React.useState('');
  return (
    <div>
      <input
        onInput={(event)=>{setUserName}}
      />
    </div>
  );
}

export default Login;
